import { combineReducers } from "redux";

import { rentals, rental } from "./rentals";
import { auth } from "./auth";
import { errors } from "./errors";

import { reducer as formReducer } from "redux-form";

export default combineReducers({
  rentals,
  rental,
  auth,
  errors,
  form: formReducer
});
